    false,nt"url": null,nt"notes": "Summary of the surface elevation data collection
    project in Putnam County, NY (NYSDEC) 2008. Products generated include LiDAR point
    data in LAS Binary format v1.1. In the spring of 2008, The Sanborn Map Company,
    Inc. (Sanborn) acquired 111 square miles of terrestrial LiDAR data in Putnam County,
    NY. An Optech ALTM 2050 Airborne LiDAR sensor was used for the collection. The LiDAR
    data associated with this metadata file is in LAS binary format, version 1.1 (ASPRS
    specification, see Cross References).",nt"license_title": null,nt"extras":
